// frontend/src/App.js أو ملف التوجيه الخاص بك
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import PrivateRoute from './components/PrivateRoute';
import AdminDashboard from './pages/admin/Dashboard';
import AllRentals from './pages/admin/AllRentals';
import FinancialReports from './pages/admin/FinancialReports';
import Analytics from './pages/admin/Analytics';
import ActivitiesLog from './pages/admin/ActivitiesLog';
import BranchesManagement from './pages/admin/BranchesManagement';
import GamesManagement from './pages/admin/GamesManagement';

function App() {
  return (
    <Router>
      <Routes>
        {/* لوحة تحكم المدير */}
        <Route path="/admin/dashboard" element={
          <PrivateRoute roles={['admin', 'manager']}>
            <AdminDashboard />
          </PrivateRoute>
        } />
        
        {/* صفحات المدير */}
        <Route path="/admin/rentals" element={
          <PrivateRoute roles={['admin', 'manager']}>
            <AllRentals />
          </PrivateRoute>
        } />
        
        <Route path="/admin/financial" element={
          <PrivateRoute roles={['admin']}>
            <FinancialReports />
          </PrivateRoute>
        } />
        
        <Route path="/admin/analytics" element={
          <PrivateRoute roles={['admin']}>
            <Analytics />
          </PrivateRoute>
        } />
        
        <Route path="/admin/activities" element={
          <PrivateRoute roles={['admin']}>
            <ActivitiesLog />
          </PrivateRoute>
        } />
        
        <Route path="/admin/branches" element={
          <PrivateRoute roles={['admin', 'manager']}>
            <BranchesManagement />
          </PrivateRoute>
        } />
        
        <Route path="/admin/games" element={
          <PrivateRoute roles={['admin', 'manager']}>
            <GamesManagement />
          </PrivateRoute>
        } />
        
        {/* إعادة التوجيه */}
        <Route path="/admin" element={<Navigate to="/admin/dashboard" />} />
        <Route path="/" element={<Navigate to="/admin/dashboard" />} />
      </Routes>
    </Router>
  );
}

export default App;
